=head2 reverse_comp
#########################################################################################
#name:      reverse_comp
#function:  return the reverse complement of a DNA sequence
#input:     (string)
#output:    reverse complement string
#########################################################################################
=cut
sub reverse_comp {
      ( my $rev = reverse $_[0] ) =~ tr/ACGTacgt/TGCAtgca/;
      return $rev;
}
=head2 clean_seq
#########################################################################################
#name:      clean_seq
#function:  a DNA sequence cleaned for everything but ACTG and N
#input:     (string reference)
#output:    clean string
#########################################################################################
=cut
sub clean_seq {
      $_[0] =~ tr/a-z/A-Z/;
      $_[0] =~ tr/ACTGN//dc;
      return $_[0]
}
=head2 clean_seq_2
#########################################################################################
#name:      clean_seq_2
#function:  a DNA sequence cleaned for everything but ACTG and N
#input:     (string reference)
#output:    same object as input but cleaned input will be modified
#########################################################################################
=cut
sub clean_seq_2 {
      my $str=$_[0];
      $str =~ tr/a-z/A-Z/;
      $str =~ tr/ACTGN//dc;
      return $str   
}
=head2 make_pos_index
#########################################################################################
#name:      make_pos_index
#function:  return an index of occurrences of a certain character in any given string
#input:     (string reference,character)
#output:    hash with character positions as keys
#########################################################################################
=cut
sub make_pos_index {
      my %pos     = ();
      my $result  = index( ${$_[0]}, $_[1], 0);
      while ( $result != -1 ) {
            $pos{$result}++;
            $result = index( ${$_[0]}, $_[1], ($result + 1) );
      }
      return %pos;
}